    displayContent = () => {
        var activeTab = this.props.activeTab
        console.log("Body.js: activeTab is",this.props.activeTab);
        if(activeTab === 1)
            return <MovieGallery/>
        else if(activeTab === 2)
            return <AddMovie/>
        else if(activeTab === 3)
            return <CreateList/>
        else 
        return <MovieGallery/>
    }
    render() {
        return (this.displayContent());

    }
}

export default Body;
